    DETERMINISTIC
BEGIN

	SET @pi80 := PI() / 180;

	SET @latitude1  := latitude1  * @pi80;
	SET @longitude1 := longitude1 * @pi80;
	SET @latitude2  := latitude2  * @pi80;
